import { Component } from '@angular/core';
import { GetqouteService } from 'src/app/services/getqoute.service';

@Component({
  selector: 'app-vehicle-list',
  templateUrl: './vehicle-list.component.html',
  styleUrls: ['./vehicle-list.component.scss']
})
export class VehicleListComponent {
  vehicles:any;
constructor(
  private vehicleService:GetqouteService,

){}


  fetchAllVehicles(): void {
    this.vehicleService.getAllVehicles().subscribe((Response) => {
      if (Response.status == 201 || Response.status==200) {
        this.personalDetailsList=Response["body"];

      }
    });
  }


}

<h2>Vehicles</h2>

<table>
  <thead>
    <tr>
      <th>Registeration Number</th>
      <th>Color</th>
      <th>Model</th>
      <th>Year</th>




    </tr>
  </thead>
  <tbody>
    <tr *ngFor="let vehicle of vehicles">
      <td>{{ vehicle.username }}</td>
      <td>{{ vehicle.email }}</td>
      <td>{{ vehicle.phoneNumber }}</td>
      <td>{{ vehicle.status }}</td>

    </tr>
  </tbody>
</table>
